# Copied from probe-rs 19178ad79ea0b937e2cbfc9e1998f379ae27b937
# probe-rs/targets/STM32H7RS_Series.yaml
#
# Removed all entries apart from the relevant one for the nucleo board.
# Avoids matching incorrect external flash algorithm in probe-rs's builtin config.
name: STM32H7RS Series
manufacturer:
  id: 0x20
  cc: 0x0
generated_from_pack: true
pack_file_release: 1.0.0
variants:
- name: STM32H7S3L8
  package_variants:
  - STM32H7S3L8Hx
  - STM32H7S3L8HxH
  cores:
  - name: main
    type: armv7em
    core_access_options: !Arm
      ap: !v1 1
  memory_map:
  - !Ram
    name: ITCM
    range:
      start: 0x0
      end: 0x30000
    cores:
    - main
  - !Nvm
    name: BANK_1
    range:
      start: 0x8000000
      end: 0x8010000
    cores:
    - main
    access:
      write: false
      boot: true
  - !Ram
    name: DTCM
    range:
      start: 0x20000000
      end: 0x20030000
    cores:
    - main
  - !Ram
    name: SRAM1
    range:
      start: 0x24000000
      end: 0x24020000
    cores:
    - main
  - !Ram
    name: SRAM2
    range:
      start: 0x24020000
      end: 0x24040000
    cores:
    - main
  - !Ram
    name: SRAM3
    range:
      start: 0x24040000
      end: 0x24060000
    cores:
    - main
  - !Ram
    name: SRAM4
    range:
      start: 0x24060000
      end: 0x24072000
    cores:
    - main
  - !Ram
    name: AHB_SRAM1
    range:
      start: 0x30000000
      end: 0x30004000
    cores:
    - main
  - !Ram
    name: AHB_SRAM2
    range:
      start: 0x30004000
      end: 0x30008000
    cores:
    - main
  flash_algorithms:
  - stm32h7rx_64k
  - mx25uw25645g_stm32h7s38-nucleo
flash_algorithms:
- name: stm32h7rx_64k
  description: STM32H7Rx_64
  default: true
  instructions: 
  load_address: 0x20000020
  pc_init: 0x1
  pc_uninit: 0x6d
  pc_program_page: 0x103
  pc_erase_sector: 0xb1
  pc_erase_all: 0x7b
  data_section_offset: 0x194
  flash_properties:
    address_range:
      start: 0x8000000
      end: 0x8010000
    page_size: 0x400
    erased_byte_value: 0xff
    program_page_timeout: 400
    erase_sector_timeout: 400
    sectors:
